import "./ProjectPreviews.css"
import ProjectTile from "./ProjectTile"
import unshore from "../Images/unshore.png";
import v3 from "../Images/v3.png";
import smartbrain from "../Images/smartbrain.png";
import ff7 from "../Images/ff7.png";
import eightBall from "../Images/eightBall.png";

const project = [    { 
    id: 'p1',
    title: 'Unshore',
    image: unshore,
    date: new Date(2021, 2, 28)},
  { 
    id: 'p2',
    title: 'Version 3 launched!',
    image: v3,
    date: new Date(2021, 3, 19)},
  { 
    id: 'p3',
    title: 'SmartBrain - Face Recognition App',
    amount: 2940.67,
    date: new Date(2021, 4, 17)},
  { 
    id: 'p4',
    title: 'Final Fantasy VII:R Product Page',
    amount: 40.00,
    date: new Date(2021, 5, 8)},
    { 
      id: 'p5',
      title: 'JavaScript Magic 8-ball',
      amount: 59.27,
      date: new Date(2021, 2, 28)}];

function ProjectPreviews(){
    return (
  <div id="projWindow">
    <section id="projects">


    {project.map(project => (
        <ProjectTile title={project.title} />
      ))}
    </section>
    <div class="seeMore">
      <ul>
        <li id="seeMore" class="flashingLight"><a href=""><li id="seeMore" class="flashingLight">see more</li></a></li>
      </ul>
    </div>
  </div>
    )
}

export default ProjectPreviews;
